  const [css, changeCss] = useState('');

  useEffect(() => {
    setTimeout(() => {
      setCount((count) => count + 1);
    }, 1000);
  });
  return (
    <>
      <Header css={css}/> 
      <LabTabs changeCss={changeCss}/>
      <Footer/>
    </>
  );
}

export default App;
